import { ErrorMessage, Field, Formik } from "formik";
import { useParams, useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import { BookedFlightAPI, retrieveAFlightById } from "../api/CallingApi";

export default function Bookedflight() {
    const navigate = useNavigate();
    const { id } = useParams();

    const [initialValues, setInitialValues] = useState({
        flightId: id !== "-1" ? id : "", // Changed to flightId to match backend expectation
        departureFrom: "",
        arrivalTo: "",
        departure: "",
        returnDate: "",
        seatsAvailable: "",
        passengerName: ""
    });

    useEffect(() => {
        const fetchFlightById = async () => {
            if (id && id !== "-1") {
                try {
                    const response = await retrieveAFlightById(id);
                    setInitialValues({
                        flightId: id, // Ensure flightId is set
                        departureFrom: response.data.departureFrom || "",
                        arrivalTo: response.data.arrivalTo || "",
                        departure: response.data.departure || "",
                        returnDate: response.data.returnDate || "",
                        seatsAvailable: response.data.seatsAvailable || "",
                        passengerName: response.data.passengerName || ""
                    });
                } catch (error) {
                    console.error("Error fetching flight:", error);
                }
            }
        };
        fetchFlightById();
    }, [id]);

    function onSubmit(values) {
        console.log("Submitting:", values);

        const ticket = {
            flightId: values.flightId, // Using flightId instead of id
            departureFrom: values.departureFrom,
            arrivalTo: values.arrivalTo,
            departure: values.departure,
            returnDate: values.returnDate,
            seatsAvailable: values.seatsAvailable,
            passengerName: values.passengerName
        };

        BookedFlightAPI(ticket)
            .then(response => {
                console.log("Booking successful:", response.data);
                navigate("/successpage");
            })
            .catch(error => {
                console.error("Booking failed:", error);
                alert("Booking failed. Please try again.");
            });
    }

    function validate(values) {
        let errors = {};
        if (!values.passengerName) {
            errors.passengerName = "Passenger name is required";
        }
        if (!values.flightId && id !== "-1") {
            errors.flightId = "Flight ID is required";
        }
        return errors;
    }

    return (
        <div className="container">
            <h2>{id === "-1" ? "Create New Booking" : "Book Flight"}</h2>
            <Formik
                initialValues={initialValues}
                enableReinitialize={true}
                onSubmit={onSubmit}
                validate={validate}
                validateOnBlur={true}
                validateOnChange={true}
            >
                {(props) => (
                    <form onSubmit={props.handleSubmit}>
                        <fieldset className="form-group">
                            <label>Flight ID</label>
                            <Field 
                                type="text" 
                                className="form-control" 
                                name="flightId" 
                                readOnly
                            />
                        </fieldset>

                        <fieldset className="form-group">
                            <label>Departure From</label>
                            <Field 
                                type="text" 
                                className="form-control" 
                                name="departureFrom" 
                                readOnly
                            />
                        </fieldset>

                        <fieldset className="form-group">
                            <label>Arrival To</label>
                            <Field 
                                type="text" 
                                className="form-control" 
                                name="arrivalTo" 
                                readOnly
                            />
                        </fieldset>

                        <fieldset className="form-group">
                            <label>Departure Date</label>
                            <Field 
                                type="date" 
                                className="form-control" 
                                name="departure" 
                                readOnly
                            />
                        </fieldset>

                        <fieldset className="form-group">
                            <label>Return Date</label>
                            <Field 
                                type="date" 
                                className="form-control" 
                                name="returnDate" 
                                readOnly
                            />
                        </fieldset>

                        <fieldset className="form-group">
                            <label>Seats Available</label>
                            <Field 
                                type="text" 
                                className="form-control" 
                                name="seatsAvailable" 
                                readOnly
                            />
                        </fieldset>

                        <ErrorMessage
                            name="passengerName"
                            component="div"
                            className="alert alert-warning"
                        />
                        <fieldset className="form-group">
                            <label>Passenger Name</label>
                            <Field 
                                type="text" 
                                className="form-control" 
                                name="passengerName" 
                            />
                        </fieldset>

                        <button className="btn btn-primary" type="submit">
                            {id === "-1" ? "Create Booking" : "Confirm Booking"}
                        </button>
                    </form>
                )}
            </Formik>
        </div>
    );
}
